import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'callSign'
})
export class CallSignPipe implements PipeTransform {

  transform(value: string): string {
    return value.slice(value.length - 3, value.length).toUpperCase();
  }

}

import { Pipe, PipeTransform } from '@angular/core';
import {FlightStatus} from "../../@types/enums";

@Pipe({
  name: 'flightStatusAsString'
})
export class FlightStatusAsStringPipe implements PipeTransform {

  transform(value: FlightStatus): string {
    switch (value) {
      case FlightStatus.Draft:
        return "בהכנה"
      case FlightStatus.Tow:
        return "בגרירה"
      case FlightStatus.Inflight:
        return "באוויר"
      case FlightStatus.Landed:
        return "לאחר נחיתה"
      default:
        return "לא ידוע"
    }
  }

}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'memberFullName'
})
export class MemberFullNamePipe implements PipeTransform {

  transform(value: { firstName: string | null, lastName: string | null, [key: string]: any }): string {
    return `${value.firstName} ${value.lastName}`;
  }

}

import {Pipe, PipeTransform} from '@angular/core';
/**
 * Pipe to transform a string to a date
 */
@Pipe({name: 'stringToDate'})
export class StringToDatePipe implements PipeTransform {
  /**
   * Constructor
   */
  constructor() {
  }
  /**
   * Transform a date that is passed as string into a date
   * @param value The date passed as string
   * @returns {Date} The Date object
   */
  transform(value: string): Date {
    return new Date(value);
  }
}

