  styleUrls: ['./dashboard-action-settings-dialog-morning-shift.component.css']
})
export class DashboardActionSettingsDialogMorningShiftComponent implements OnInit {
  Texts = Texts

  fieldResponsible = new FormControl();
  fieldResponsibles: GetMembers_members[] = [];
  filteredFieldResponsibles!: Observable<GetMembers_members[]>;

  constructor(
    private membersService: MembersService,
    private memberFullNamePipe: MemberFullNamePipe,
    @Inject(MAT_DIALOG_DATA) public data: IActionSettingsDialogMorningShiftData
  ) { }

  ngOnInit(): void {

    this.membersService
      .getMembers()
      .subscribe(({data, loading}) => {
        this.fieldResponsibles = [...data.members]

        this.filteredFieldResponsibles = this.fieldResponsible.valueChanges.pipe(
          startWith(""),
          map(value => this._filterFieldResponsible(value))
        );

        const fieldResponsible = this.fieldResponsibles.find(option => option.id === this.data.fieldResponsibleId)
        this.fieldResponsible.setValue(fieldResponsible)
      })
  }


  private _filterFieldResponsible(value: any) {
    let filterValue = typeof value === "string"
      ? value
      : this.memberFullNamePipe.transform(value)

    return this.fieldResponsibles.filter(
      member => this.memberFullNamePipe.transform(member).includes(filterValue)
    );
  }

  memberDisplayFn = (pilot: GetMembers_members | undefined) => {
    return pilot ? this.memberFullNamePipe.transform(pilot) : ""
  }


}

