import {DashboardFlightFirstPilotSelectionDialogComponent} from "../dashboard-flight-first-pilot-selection-dialog/dashboard-flight-first-pilot-selection-dialog.component";

export interface ITowPilotSelectionDialogData {
  memberId: number | undefined
}

@Component({
  selector: 'app-dashboard-flight-tow-pilot-selection-dialog',
  templateUrl: './dashboard-flight-tow-pilot-selection-dialog.component.html',
  styleUrls: ['./dashboard-flight-tow-pilot-selection-dialog.component.css']
})
export class DashboardFlightTowPilotSelectionDialogComponent implements OnInit {

  Texts = Texts
  options: GetMembers_members[] = []
  member = new FormControl();
  filteredOptions!: Observable<GetMembers_members[]>;

  constructor(
    private membersService: MembersService,
    public dialogRef: MatDialogRef<DashboardFlightFirstPilotSelectionDialogComponent>,
    @Inject(MAT_DIALOG_DATA) public data: ITowPilotSelectionDialogData
  ) {
  }

  ngOnInit(): void {
    this.membersService
      .getMembers()
      .subscribe(({data, loading}) => {
        this.options = [...data.members]

        this.filteredOptions = this.member.valueChanges.pipe(
          startWith(""),
          map(value => this._filter(value))
        );

        const member = this.options.find(option => option.id === this.data.memberId)
        this.member.setValue(member)
      })


  }

  confirm() {
    const memberId = this.member.value.id;
    this.dialogRef.close({ memberId });
  }

  private _filter(value: any) {
    let filterValue = typeof value === "string"
      ? value
      : `${value.firstName} ${value.lastName}`

    return this.options.filter(
      member => this.memberFullNamePipe.transform(member).includes(filterValue)
    );
  }

  displayFn(member: GetMembers_members | undefined) {
    return member ? `${member.firstName} ${member.lastName}` : ""
  }

  onNoClick(): void {

    this.dialogRef.close();
  }

}

import {Component, Inject, OnInit} from '@angular/core';
import {TowTypesService} from "../shared/services/tow-types.service";
import {MAT_DIALOG_DATA, MatDialogRef} from "@angular/material/dialog";
import {map, startWith} from "rxjs/operators";
import {FormControl} from "@angular/forms";
import {GetTowTypes_towTypes} from "../shared/graphql/types/GetTowTypes";
import {Observable} from "rxjs";
import { Texts } from 'src/app/@types/enums';

export interface ITowTypeSelectionDialogData {
  towTypeId: number | undefined;
}

@Component({
  selector: 'app-dashboard-tow-type-selection-dialog',
  templateUrl: './dashboard-tow-type-selection-dialog.component.html',
  styleUrls: ['./dashboard-tow-type-selection-dialog.component.css']
})
export class DashboardTowTypeSelectionDialogComponent implements OnInit {

  Texts = Texts
  options: GetTowTypes_towTypes[] = []
  towType = new FormControl();
  filteredOptions!: Observable<GetTowTypes_towTypes[]>;

  constructor(
    private towTypeService: TowTypesService,
    public dialogRef: MatDialogRef<DashboardTowTypeSelectionDialogComponent>,
    @Inject(MAT_DIALOG_DATA) public data: ITowTypeSelectionDialogData
  ) {
  }

  ngOnInit(): void {
    this.towTypeService
      .getGliders()
      .subscribe(({data, loading}) => {
        this.options = [...data.towTypes]

        this.filteredOptions = this.towType.valueChanges.pipe(
          startWith(""),
          map(value => this._filter(value))
        );

        const towType = this.options.find(option => option.id === this.data.towTypeId)
        this.towType.setValue(towType)
      })


  }

  confirm() {
    const towTypeId = this.towType.value.id;
    this.dialogRef.close({ towTypeId });
  }

  private _filter(value: any) {
    let filterValue = typeof value === "string"
      ? value
      : value.name

    return this.options.filter(
      towType => towType.name.includes(filterValue)
    );
  }

  displayFn = (towType: GetTowTypes_towTypes | undefined) => {
    return towType?.name || ""
  }

  onNoClick(): void {
    this.dialogRef.close();
  }

}

