import {MUTATION_CREATE_FLIGHT, MUTATION_DELETE_FLIGHT, MUTATION_UPDATE_FLIGHT} from '../graphql/mutations';
import { QUERY_GET_ACTION_FLIGHTS } from '../graphql/queries';
import {GetFlights, GetFlightsVariables} from "../graphql/types/GetFlights";
import {CreateFlight, CreateFlightVariables} from "../graphql/types/CreateFlight";
import {CreateFlightInput, UpdateFlightInput} from "../../../types/graphql-global-types";
import {DeleteFlight, DeleteFlightVariables} from "../graphql/types/DeleteFlight";
import {UpdateFlight, UpdateFlightVariables} from "../graphql/types/UpdateFlight";

@Injectable({
  providedIn: 'root'
})
export class FlightsService {

  constructor(
    private apollo: Apollo
  ) { }

  getFlights(actionId: number) {
    return this.apollo.watchQuery<GetFlights, GetFlightsVariables>({
      query: QUERY_GET_ACTION_FLIGHTS,
      variables: {
        actionId
      }
    }).valueChanges
  }

  createFlight(data: CreateFlightInput) {
    return this.apollo.mutate<CreateFlight, CreateFlightVariables>({
      mutation: MUTATION_CREATE_FLIGHT,
      variables: {
        data
      }
    })
  }

  updateFlight(id: number, data: UpdateFlightInput) {
    return this.apollo.mutate<UpdateFlight, UpdateFlightVariables>({
      mutation: MUTATION_UPDATE_FLIGHT,
      variables: {
        id,
        data
      }
    })
  }

  deleteFlight(id: number) {
    return this.apollo.mutate<DeleteFlight, DeleteFlightVariables>({
      mutation: MUTATION_DELETE_FLIGHT,
      variables: {
        id
      }
    })
  }
}

