export class DashboardFlightAirplaneSelectionDialogComponent implements OnInit {
  Texts = Texts
  options: GetAirplanes_airplanes[] = []
  airplane = new FormControl();
  filteredOptions!: Observable<GetAirplanes_airplanes[]>;

  constructor(
    private airplanesService: AirplanesService,
    private callSignPipe: CallSignPipe,
    public dialogRef: MatDialogRef<DashboardFlightAirplaneSelectionDialogComponent>,
    @Inject(MAT_DIALOG_DATA) public data: IAirplaneSelectionDialogData
  ) {
  }

  ngOnInit(): void {
    this.airplanesService
      .getAirplanes()
      .subscribe(({data, loading}) => {
        this.options = [...data.airplanes]

        this.filteredOptions = this.airplane.valueChanges.pipe(
          startWith(""),
          map(value => this._filter(value))
        );

        const airplane = this.options.find(option => option.id === this.data.airplaneId)
        this.airplane.setValue(airplane)
      })


  }

  confirm() {
    const airplaneId = this.airplane.value.id;
    this.dialogRef.close({ airplaneId });
  }

  private _filter(value: any) {
    let filterValue = typeof value === "string"
      ? value
      : this.callSignPipe.transform(value.callSign)

    return this.options.filter(
      airplane => this.callSignPipe.transform(airplane.callSign).includes(filterValue)
    );
  }

  displayFn = (airplane: GetAirplanes_airplanes | undefined) => {
    return airplane && airplane.callSign ? this.callSignPipe.transform(airplane.callSign) : ""
  }

  onNoClick(): void {
    this.dialogRef.close();
  }

}

