})
export class DashboardFlightComponent implements OnInit {
  Texts = Texts

  @Input() flightStatus!: FlightStatus;
  @Input() flight!: GetFlights_flights
  @Output() flightDeletedEvent = new EventEmitter<number>();
  @Output() flightLandedEvent = new EventEmitter<number>();
  @Output() flightTakeOffCanceledEvent = new EventEmitter<number>();
  @Output() flightReleaseCanceledEvent = new EventEmitter<number>();
  @Output() flightLandingCanceledEvent = new EventEmitter<number>();
  @Output() flightUpdatedEvent = new EventEmitter<{ id: number, updates: UpdateFlightInput }>();

  expanded: boolean = false

  constructor(
    public dialog: MatDialog
  ) {
  }

  openFirstPilotSelectionDialog(): void {
    const dialogRef = this.dialog.open(DashboardFlightFirstPilotSelectionDialogComponent, {
      data: {
        memberId: this.flight.pilot1?.id
      }
    });

    const flight = this.flight;
    dialogRef.afterClosed().subscribe((result: IFirstPilotSelectionDialogData) => {
      if (result.memberId && result.memberId !== flight.pilot1?.id) {
        this.flightUpdatedEvent.emit({id: this.flight.id, updates: {pilot1Id: result.memberId || null}})
      }
    });
  }

  openSecondPilotSelectionDialog(): void {
    const dialogRef = this.dialog.open(DashboardFlightSecondPilotSelectionDialogComponent, {
      data: {
        memberId: this.flight.pilot2?.id
      }
    });

    const flight = this.flight;
    dialogRef.afterClosed().subscribe((result: ISecondPilotSelectionDialogData) => {
      if (result.memberId && result.memberId !== flight.pilot2?.id) {
        this.flightUpdatedEvent.emit({id: this.flight.id, updates: {pilot2Id: result.memberId || null}})
      }
    });
  }

  openTowPilotSelectionDialog(): void {
    const dialogRef = this.dialog.open(DashboardFlightTowPilotSelectionDialogComponent, {
      data: {
        memberId: this.flight.towPilot?.id
      }
    });

    const flight = this.flight;
