  }

  public flightStatusCanceled() {
    switch (this.flightStatus) {
      case FlightStatus.Tow:
        return this.flightTakeOffCanceled()
      case FlightStatus.Inflight:
        return this.flightReleaseCanceled()
      case FlightStatus.Landed:
        return this.flightLandingCanceled()
      default:
        return
    }
  }

  public async deleteFlight() {
    this.flightDeletedEvent.emit(this.flight.id)
  }

  public async flightLanded() {
    this.flightLandedEvent.emit(this.flight.id)
  }

  public async flightTakeOffCanceled() {
    this.flightTakeOffCanceledEvent.emit(this.flight.id)
  }

  public async flightReleaseCanceled() {
    this.flightReleaseCanceledEvent.emit(this.flight.id)
  }

