    this.flightLandingCanceledEvent.emit(this.flight.id)
  }

  public get cancelTooltipText() {
    switch (this.flightStatus) {
      case FlightStatus.Tow:
        return "ביטול ההמראה"
      case FlightStatus.Inflight:
        return this.flight.glider?.selfLaunch ? "ביטול ההמראה" : "ביטול הגרירה"
      case FlightStatus.Landed:
        return "ביטול הנחיתה"
