import {Component, OnInit} from '@angular/core';
import {FlightsService} from "../shared/services/flights.service";
import {GetFlights_flights} from "../shared/graphql/types/GetFlights";
import {FlightStatus, Texts} from 'src/app/@types/enums';
import {ACTION_ID} from "../../consts";
import {UpdateFlightInput} from "../../../types/graphql-global-types";

@Component({
  selector: 'app-dashboard-flights',
  templateUrl: './dashboard-flights.component.html',
  styleUrls: ['./dashboard-flights.component.css']
})
export class DashboardFlightsComponent implements OnInit {
  Texts = Texts
  FlightStatus = FlightStatus
  flights: GetFlights_flights[] = []

  constructor(
    private flightsService: FlightsService
  ) {
  }


  ngOnInit(): void {
    this.flightsService
      .getFlights(ACTION_ID)
      .subscribe(({data, loading}) => {
        this.flights = [...data.flights]
      })
  }

  public async updateFlight(event: { id: number, updates: UpdateFlightInput }) {
    const { id, updates } = event
    const response = await this.flightsService.updateFlight(id, updates).toPromise()

    const {updateFlight} = response.data || {}
    if (updateFlight) {
      this.flights = this.flights.map(flight => flight.id === id ? updateFlight : flight)
    }
  }

  public get dispatchFlights() {
    return this.flights
      .filter(flight => !flight.takeOffAt && !flight.towType && !flight.landingAt)
      .sort((a, b) => a.id > b.id ? 1 : -1)
  }

  public get towFlights() {
    return this.flights
      .filter(flight => flight.takeOffAt && !flight.landingAt && !flight.towType && !flight.glider?.selfLaunch)
      .sort((a, b) => {
        if (!a.glider?.selfLaunch && !b.glider?.selfLaunch) {
          if (a.towType && !b.towType) {
            return 1
          } else if (!a.towType && b.towType) {
            return -1
          } else {
            return a.takeOffAt > b.takeOffAt ? 1 : -1
          }
        } else {
          return a.takeOffAt > b.takeOffAt ? 1 : -1
        }
      })
  }

  public get inflightFlights() {
    return this.flights
      .filter(flight => flight.takeOffAt && (flight.towType || flight.glider?.selfLaunch) && !flight.landingAt)
      .sort((a, b) => {
        if (!a.glider?.selfLaunch && !b.glider?.selfLaunch) {
          if (a.towType && !b.towType) {
            return 1
          } else if (!a.towType && b.towType) {
            return -1
          } else {
            return a.takeOffAt > b.takeOffAt ? 1 : -1
          }
        } else {
          return a.takeOffAt > b.takeOffAt ? 1 : -1
        }
      })
  }

  public get landedFlights() {
    return this.flights
      .filter(flight => flight.takeOffAt && flight.towType && flight.landingAt)
      .sort((a, b) => a.landingAt > b.landingAt ? 1 : -1)
  }

  public async createFlight() {
    const response = await this.flightsService.createFlight({
      actionId: ACTION_ID,
    }).toPromise()
    if (response.data?.createFlight) {
      this.flights = [...this.flights, response.data?.createFlight]
    }
  }

  async flightTakeOffCanceled(id: number) {
    if (!confirm(Texts.ConfirmFlightTakeOffCancel)) {
      return
    }

    const response = await this.flightsService.updateFlight(id, {
      takeOffAt: null,
      towTypeId: null,
      landingAt: null,
      towPilotId: null,
      airplaneId: null
    }).toPromise()

    const {updateFlight} = response.data || {}
    if (updateFlight) {
      this.flights = this.flights.map(flight => flight.id === id ? updateFlight : flight)
    }
  }

  async flightReleaseCanceled(id: number) {
    if (!confirm(Texts.ConfirmFlightReleaseCancel)) {
      return
    }

    const response = await this.flightsService.updateFlight(id, {
      towTypeId: null,
      landingAt: null,
    }).toPromise()

    const {updateFlight} = response.data || {}
    if (updateFlight) {
      this.flights = this.flights.map(flight => flight.id === id ? updateFlight : flight)
    }
  }

  async flightLanded(id: number) {
    const flight: GetFlights_flights = this.flights.find(_flight => _flight.id === id)!
    if (!flight.glider?.selfLaunch && !flight.towType) {
      alert(Texts.CannotMoveToLandedIfNoTowTypeSelectedForTowedGliderAlert)
      return
    }

    const now = new Date().toISOString()

    const response = await this.flightsService.updateFlight(id, {
      landingAt: now
    }).toPromise()

    const {updateFlight} = response.data || {}
    if (updateFlight) {
      this.flights = this.flights.map(flight => flight.id === id ? updateFlight : flight)
    }
  }

  async flightLandingCanceled(id: number) {
    if (!confirm(Texts.ConfirmFlightLandingCancel)) {
      return
    }

    const response = await this.flightsService.updateFlight(id, {
      landingAt: null
    }).toPromise()

    const {updateFlight} = response.data || {}
    if (updateFlight) {
      this.flights = this.flights.map(flight => flight.id === id ? updateFlight : flight)
    }
  }

  async deleteFlight(id: number) {
    if (!confirm(Texts.ConfirmFlightDeletion)){
      return
    }

    const response = await this.flightsService.deleteFlight(id).toPromise()
    if (response.data?.deleteFlight)
      this.flights = this.flights.filter(flight => flight.id !== id)
  }
}

